import React from "react";
import styled from "styled-components";

const LoginDivStyle = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 20px;
  & form {
    font-size: 14px;
    display: flex;
    flex-direction: column;
    & span {
      margin: 5px 0px;
    }
    & input {
      color: #fff;
      font-size: 14px;
      background: #0f212e;
      box-shadow: none;
      outline-style: none;
      border-color: transparent;
      border-radius: 3px;
      padding: 3px;
      margin: 6px 0px;
    }
  }
`;

const Login = () => {
  return (
    <LoginDivStyle>
      <form>
        <span>Email</span>
        <input type="text" />
        <span>Password</span>
        <input type="password" />
      </form>
    </LoginDivStyle>
  );
};

export default Login;
